import React from "react";
import "./header.css";

function Jumbotron() {
  return (
    <div className="jumbotron text-center">
      <h1>(React) Search for Books Below!</h1>
      <h3>Search for Any Book and Save Any Books of Interest</h3>
    </div>
  );
}

export default Jumbotron;
